 What is AGTS?  

AgenTensor is a special tool that helps people check if content like pictures, videos, and text are real or fake. It can spot sneaky deepfakes and shows if something was made by a computer. Users earn tokens by helping the network grow with their skills. This project helps keep the internet safe from tricks and scams, making it easier to trust what you see!  

 Team and Partnerships  

The AgenTensor team is made up of smart people who know a lot about technology and safety online. They have experience in building cool tech tools and have strong connections in the crypto world. They want to make online spaces better for everyone and work with other teams to reach their goals, so they are ready to help everybody stay safe and informed!  

